import Link from "next/link";
import { TagContent } from "../lib/tags";
import { Box } from "@chakra-ui/core";

type Props = {
  tag: TagContent;
};
export default function Tag({ tag }: Props) {
  return (
    <Link href={"/posts/tags/[[...slug]]"} as={`/posts/tags/${tag.slug}`}>
      <Box as="a" mr={2}>
      {"#" + tag.name}
      </Box>
    </Link>
  );
}
